        };
    }

    componentDidMount() {

        //useScript("path-to/bower_components/crypto-js/crypto-js.js");
        const oauth = OAuth({
            consumer: {
                key: '8fb7ec71f8b4e1f2ec28d2f8c3f7785a',
                secret: 'af035f0f340e090d5b51870f9a168acd',
            },
            signature_method: 'HMAC-SHA1',
            hash_function(base_string, key) {
                return CryptoJS.HmacSHA1(base_string, key).toString(CryptoJS.enc.Base64)
            },
        })

        const request_data = {
            url: 'https://api-qa.goopter.com/api/rest/v7/customerinfo',
            method: 'GET',
            //data: { status: 'Hello Ladies + Gentlemen, a signed OAuth request!' },
        }

        // Note: The token is optional for some requests
        const token = {
            key: 'p3pky64wm8y3eob0pehv3ou3g2huy3vs',
            secret: 'iweozq95esbdtcyh8g8tyohijz9v8xub',
        }


        $.ajax({
            url: request_data.url,
            type: request_data.method,
            headers: oauth.toHeader(oauth.authorize(request_data, token)),
        }).done(function(data) {
            console.log(data)
            // Process your data here
        })
    }


